// define global vars
var totalitems = 14; // how many columns
// list of parts
//  , each word here must also have a 'matching-named' 'var'
//   , with the desired content to be shown -
//    , the related vars here are at the end of this document
var listofparts = [
    "passionfruit",
    "chocolate",
    "cinnamon",
    "nut",
    "ball",
];
// count how many items in array
var totalparts = listofparts.length;
//console.log('totalparts: '+totalparts); //debugging
/* ------------------------------------------------------------------------------ */
// init page
$(document).ready(function() {
    j = 0; //count1
    $(".eqi-container > div").each(function() {
        // lets write the next image content
        //  ,  to DOM for EACH of the current instances of thie distinct element
        $(this).html(place());
        //$('.count').text(j+1); //debugging
        j++; // incrmeent counter
    });
    i = 0; //count2
    $(".eqi-container2 > div").each(function() {
        // lets write the next image content
        //  ,  to DOM for EACH of the current instances of thie distinct element
        $(this).html(place());
        //$('.count').text(i+1); //debugging
        i++; //increment counter
    });
});
/* ------------------------------------------------------------------------------ */


/* ------------------------------------------------------------------------------ */
// functions
var c = 0; // count of list item
function place() {
    c++; // count of list item increment
    // console.log('nth='+c); //debugging
    nextimg = imgpls(); //console.log('nextimg: '+nextimg);
    // global function call to render the svg content as they are returned
    //  , based on a name, from array[STRING] -> variable [SVG Content]
    return window[imgcur];
    // returns current word based on count / modulus to index items
}
// Keep track of image name from array
//  , based on incremental value accross all instances of a distinct element
var imgplscount = 0; //init count of imageplscount
function imgpls() {
    //  console.log('total parts: '+totalparts);
    //  console.log('imgplscount: '+imgplscount);
    //  console.log(listofparts);
    imgplscount = (imgplscount) % totalparts; // lets get the divisor
    imgnxt = imgplscount++; // increment for continuity
    imgcur = listofparts[imgnxt]; // render output - used globally
}
